import React from 'react';

function Story() {
  return (
    <div style={{ position: 'relative', backgroundColor: 'black', height: '100vh' }}>
      <h1 style={{ position: 'absolute', top: '20px', right: '20px', color: 'white', fontSize: '2rem' }}>Our Story</h1>
      <video autoPlay loop muted style={{ position: 'absolute', top: '50px', right: '50px', maxHeight: 'calc(100vh - 100px)' }} src="https://www.exoape.com/video/video-6.mp4"></video>
    </div>
  );
}

export default Story;
